import React from 'react'
import './Sidebar.css'
import Logo from '../../imgs/logo.ico'
import { SidebarData } from '../../Data/Data';

const Sidebar = () => {
  return (
    <div className="Sidebar">
      {/* logo */}
      <div className="logo">
        <img src={Logo} alt="#" />
        <span>
          Groo<span>Be</span>
        </span>
      </div>
      <div className="menu">
        {SidebarData.map((item, index)=>{
          return(
            <div className="menuItem">
              <item.icon/>
              <span>
                {item.heading}
              </span>
            </div>
          )
        })}
      </div>
    </div>
  )
}

export default Sidebar;
